INSERT INTO `sources` VALUES (1,'DMuDB','','','support@dmudb.net','dmudb','http://www.ngrl.org.uk/Manchester/projects/informatics/dmudb','Diagnostic Mutation Database','The Diagnostic Mutation Database (DMuDB) was established in 2005 by NGRL as a repository of diagnostic variant data, to support the diagnostic process in UK genetic testing laboratories. NGRL developed DMuDB in response to a need amongst UK laboratories for an easy and secure way to share variant data in order to support the interpretation of new variants and improve the quality and consistency of diagnoses. Access to DMuDB has now been extended to non-UK laboratories through a partnership with EMQN. ','online','mysql','0000-00-00 00:00:00','','','','','','','','');
